import React from 'react';
import PrimeReactProvider from 'primereact/provider'; // Example import for PrimeReactProvider
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Correct import for BrowserRouter
import Home from './components/Home'; // Adjust path if necessary
import Blogs from './components/Blogs'; // Adjust path if necessary
import './App.css';

function App() {
  return (
    <PrimeReactProvider> {/* Example usage of PrimeReactProvider */}
      <Router>
        <div>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/blog" element={<Blogs />} />
          </Routes>
        </div>
      </Router>
    </PrimeReactProvider>
  );
}

export default App;
